import {useState} from "react";


function NavBar(){
  const logo = "Youness OFPPT 2A"

  const[version , newVersion] = useState(8)

  const handleClick = () => {
      newVersion(9)
  }

  return(
    <nav className="navigationMenu">
      <span> { logo }</span>
      <div className='links'>
        <a href='/'>Home</a>
        <a href='/react'>REACT JS</a>
        <a href='/laravel'>LARAVEL { version }</a>
        <a href='/mySQL'>Procedural mySQL</a>
        <a href="/mongoDB">MongoDB</a>
        <a href="/uml">UML</a>
        <a href="/jira">JIRA</a>
        <a href="/Figma">FIGMA</a>
        <a href="/git">GIT / GITLAB</a>
        <a href="/mongoDB">MongoDB</a>
        <a href="/azure">AZURE</a>
        <button>Get laravel version</button>

      </div>
    </nav>
  )
}


export default NavBar ;
